import React from 'react'

function NameList() {
    const persons = [
      {
        id: 1,
        name: "Brucee",
        age: 30,
        skill: "React",
      },
      {
        id: 2,
        name: "Namboy",
        age: 20,
        skill: "PHP",
      },
      {
        id: 3,
        name: "Dede",
        age: 10,
        skill: "Android",
      },
    ];
    const personList = persons.map(person => <h2>I am {person.name}. I am {person.age} years old. I know {person.skill}</h2>);

    return (
        <div>
            {personList}
        </div>
    )
}

export default NameList
